# requests와 BeautifulSoup 라이브러리 호출
# 라이브러리를 사용하려면 반드시 import 명령어를 통해 라이브러리를 호출해주어야 함
import requests
from bs4 import BeautifulSoup

# 크롤링 하려는 사이트 주소를 넣고 html 코드를 불러옴

url = "https://search.naver.com/search.naver?where=nexearch&sm=tab_jum&query=sesac"
r = requests.get(url)
soup = BeautifulSoup(r.text, "html.parser")

# requests.get()은 get 요청으로 사이트의 정보를 가져오고 
# BeautifulSoup는 get()을 통해 가져온 정보의 html코드를 편하게 다룰 수 있게 만듦
print(soup)

